import './App.css';
import LoginPage from './components/LoginPage/LoginPage';

function App() {
 return (
    <div className="min-h-screen bg-blue-500 flex items-center justify-center">
      <h1 className="text-white text-3xl mb-4">Trước LoginPage</h1>
      <LoginPage />
      <h1 className="text-white text-3xl mt-4">Sau LoginPage</h1>
    </div>
  );
}

export default App;
